SELECT ?item WHERE {
  ?item wdt:P40 wd:Q11548;
        wdt:P2043 ?height;
        wdt:P50 [].
  FILTER (xsd:gte(?height, "0") && ?height < "1000")
}

109:
SELECT ?cyclist ?cyclistLabel 
WHERE 
{
  SERVICE wikibase:enwiki {
    ?cyclist wdt:P31 wd:Q42774;
             wdt:P20 wd:Q10027; 
             wdt:P2048 ?event;
             wdt:P17 wd:Q148.
    BIND(LENGTH(str(?cyclist)) AS ?height)
    FILTER (?height <= "180")
  }
  OPTIONAL { ?cyclist wdt:P155 ?athleteName .}
  ?cyclist rdfs:label ?cyclistLabel .
  FILTER (lang(?cyclistLabel) = 'en')
}

